import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

export default function Home() {
  return (
    <div className="home">
      {/* Title */}
      <h1 className="home__title">FLIP N MATCH</h1>

      {/* Icons row */}
      <div className="home__icons">
        <img src="" alt="cloud" className="home__icon" />
        <img src="" alt="heart" className="home__icon" />
        <img src="" alt="spade" className="home__icon" />
        <img src="" alt="cloud" className="home__icon" />
      </div>

      {/* Difficulty cards */}
      <div className="home__cards">
        <Link to="/easy">
          <img src="" alt="Easy" className="home__card" />
        </Link>
        <Link to="/medium">
          <img src="" alt="Medium" className="home__card" />
        </Link>
        <Link to="/hard">
          <img src="" alt="Hard" className="home__card" />
        </Link>
      </div>

      {/* Brick ground */}
      <div className="home__ground" />
    </div>
  );
}
